(function(){var loadHandler=window['sl_{A0B68580-E2A3-47CC-B651-C08E56767E1D}'];loadHandler&&loadHandler(24, '<div id="spr0_9510917"><div id="spr1_9510917" class="kern slide"><img id="img2_9510917" src="data:image/png;base64," width="1280px" height="720px" alt="" style="left:0px;top:0px;"/><div id="spr3_9510917" style="left:986.15px;top:662.674px;"><div id="spr4_9510917"><img id="img0_9510917" src="data:image/png;base64," width="273.75" height="48" alt="" style="left:0.06px;top:-0.065px;"/></div></div></div><div id="spr2_9510917" class="kern slide"><div id="spr5_9510917" style="left:112.988px;top:14.529px;"><div style="width:0px;"><span id="txt0_9510917" data-width="373.789062" style="left:9.6px;top:3.78px;">Procedural Steps Involved in IVF</span></div></div><div id="spr6_9510917" style="left:112.988px;top:14.529px;"><div style="width:0px;"><span id="txt1_9510917" class="relpos" data-width="24.000000" style="left:9.6px;top:400.898px;">1. </span> <span id="txt2_9510917" class="relpos" data-width="115.699219" style="left:9.593px;top:400.898px;">Stimulation</span> <span id="txt3_9510917" class="relpos" style="left:9.587px;top:400.898px;">:</span> <span id="txt4_9510917" class="relpos" data-width="859.746094" style="left:9.58px;top:400.898px;"> Injections of the hormone FSH to stimulate the maturation of multiple follicles/oocytes.</span></div></div><div id="spr7_9510917" style="left:112.988px;top:14.529px;"><div style="width:0px;"><span id="txt5_9510917" class="relpos" data-width="24.000000" style="left:9.6px;top:433.732px;">2. </span> <span id="txt6_9510917" class="relpos" data-width="124.429688" style="left:9.593px;top:433.732px;">Egg retrieval</span> <span id="txt7_9510917" class="relpos" style="left:9.587px;top:433.732px;">:</span> <span id="txt8_9510917" class="relpos" data-width="883.300781" style="left:9.58px;top:433.732px;"> Usually 8–15 eggs are retrieved surgically. Note: the mother’s ovary will not have a corpus</span></div><div style="width:0px;"><span id="txt9_9510917" data-width="369.515625" style="left:9.6px;top:466.565px;">luteum as ovulation has not occurred.</span></div></div><div id="spr8_9510917" style="left:112.988px;top:14.529px;"><div style="width:0px;"><span id="txt10_9510917" class="relpos" data-width="24.000000" style="left:9.6px;top:499.398px;">3. </span> <span id="txt11_9510917" class="relpos" data-width="64.359375" style="left:9.593px;top:499.398px;">Sperm</span> <span id="txt12_9510917" class="relpos" style="left:9.587px;top:499.398px;">:</span> <span id="txt13_9510917" class="relpos" data-width="328.136719" style="left:9.58px;top:499.398px;"> Frozen or donor sperm obtained.</span></div></div><div id="spr9_9510917" style="left:112.988px;top:14.529px;"><div style="width:0px;"><span id="txt14_9510917" class="relpos" data-width="24.000000" style="left:9.6px;top:532.232px;">4. </span> <span id="txt15_9510917" class="relpos" data-width="119.015625" style="left:9.593px;top:532.232px;">Fertilization</span> <span id="txt16_9510917" class="relpos" style="left:9.587px;top:532.232px;">:</span> <span id="txt17_9510917" class="relpos" data-width="670.804688" style="left:9.58px;top:532.232px;"> Sperm and eggs are placed in a petri dish “in vitro = in glass/plastic”.</span></div></div><div id="spr10_9510917" style="left:112.988px;top:14.529px;"><div style="width:0px;"><span id="txt18_9510917" class="relpos" data-width="24.000000" style="left:9.6px;top:565.065px;">5. </span> <span id="txt19_9510917" class="relpos" data-width="215.214844" style="left:9.593px;top:565.065px;">Embryo development</span> <span id="txt20_9510917" class="relpos" style="left:9.587px;top:565.065px;">:</span> <span id="txt21_9510917" class="relpos" data-width="188.472656" style="left:9.58px;top:565.065px;"> Incubate 2–3 days.</span></div></div><div id="spr11_9510917" style="left:112.988px;top:14.529px;"><div style="width:0px;"><span id="txt22_9510917" class="relpos" data-width="24.000000" style="left:9.6px;top:597.898px;">6. </span> <span id="txt23_9510917" class="relpos" data-width="161.695312" style="left:9.593px;top:597.898px;">Embryo transfer</span> <span id="txt24_9510917" class="relpos" style="left:9.587px;top:597.898px;">:</span> <span id="txt25_9510917" class="relpos" data-width="306.679688" style="left:9.58px;top:597.898px;"> To the uterus for implantation.</span></div></div><div id="spr12_9510917" style="left:112.988px;top:14.529px;"><div style="width:0px;"><span id="txt26_9510917" class="relpos" data-width="24.000000" style="left:9.6px;top:630.732px;">7. </span> <span id="txt27_9510917" class="relpos" data-width="282.503906" style="left:9.593px;top:630.732px;">Administration of hormones</span> <span id="txt28_9510917" class="relpos" style="left:9.587px;top:630.732px;">:</span> <span id="txt29_9510917" class="relpos" data-width="631.324219" style="left:9.58px;top:630.732px;"> Estrogen and progesterone to build and maintain endometrium.</span></div></div><div id="spr13_9510917" style="left:170.017px;top:54.807px;"><div id="spr14_9510917"><img id="img1_9510917" src="data:image/jpeg;base64," width="898.5" height="355.5" alt="" style="left:-0.137px;top:0.137px;"/></div></div><div id="spr15_9510917" style="left:1224.769px;"><div id="svg0_9510917" style="left:5.031px;top:4.251px;"><svg width="47" height="28" viewBox="0 0 47 28"><path fill="#c00000" d="M0,0 h46.08 v27.429 h-46.08 Z"/></svg></div><div id="svg1_9510917" style="left:0px;top:0px;"><svg width="65" height="28" viewBox="0 0 65 28"><path fill="none" d="M0,0 h64.174 v27.433 h-64.174 Z"/></svg></div><div id="spr16_9510917"><div style="width:0px;"><span id="txt30_9510917" data-width="42.155083" style="left:9.598px;top:2.268px;">END</span></div></div></div></div></div>', '{"s":[]}');})();